/**
 *@title CommitteeDAO.
 *@author Duncan Brain <duncan@brainenterprise.ca>
 *@version 0.5
 *@notice This is a multiple signature wallet that adapts the transaction object to include a proposal parameter. Motion
 * was chosen as a function of committees. The motion pass requirement is set at 50% + 1.
 */

pragma solidity ^0.5.0;

import "./MultiSigWallet.sol";
import "./Nameable.sol";

contract CommitteeDAOMultiSig is MultiSigWallet, Nameable{

    /*
     *  Storage
     */
    mapping(uint => ProposalTransaction) proposalTransactions;

    struct ProposalTransaction {
        address destination;
        uint value;
        bytes data;
        bool executed;
        string proposal;
    }

    /*
     *  Modifiers
     */
    ///@dev Overrides the MultiSigWallet struct transactions with proposalTransactions
    modifier transactionExists(uint transactionId) {
        require(proposalTransactions[transactionId].destination != address(0));
        _;
    }

    ///@dev Overrides the MultiSigWallet struct transactions with proposalTransactions
    modifier notExecuted(uint transactionId) {
        require(!proposalTransactions[transactionId].executed);
        _;
    }

    /*
     * Public functions
     */
    ///@dev Sets MultiSigWallet transaction pass requirement to 50% + 1.
    constructor(address[] memory _owners, string memory name) public
        MultiSigWallet(_owners, _owners.length/2 + 1)
        Nameable(name)
    {}

    ///@dev Called by a owner to name.
    function reName(string memory _name) public onlyWallet{
        name = _name;
        emit Renamed(name);
    }

    /// @dev Overrides MultiSigWallet to keep transaction pass requirement to 50% + 1
    function addOwner(address owner)
        public
        onlyWallet
        ownerDoesNotExist(owner)
        notNull(owner)
    {
        isOwner[owner] = true;
        owners.push(owner);
        changeRequirement((owners.length/2) + 1);
        emit OwnerAddition(owner);
    }

    /// @dev Overrides MultiSigWallet to keep transaction pass requirement to 50% + 1
    function removeOwner(address owner)
        public
        onlyWallet
        ownerExists(owner)
    {
        isOwner[owner] = false;
        for (uint i = 0; i < owners.length - 1; i++){
            if (owners[i] == owner) {
                owners[i] = owners[owners.length - 1];
                break;
            }
        }
        owners.length -= 1;
        changeRequirement(owners.length/2 + 1);
        emit OwnerRemoval(owner);
    }

    /// @dev Overrides MultiSigWallet to allow for proposal object in proposalTransaction
    /// @param proposal is an explanation of the transaction
    function submitTransaction(address destination, uint value, bytes calldata data, string calldata proposal)
        external
        ownerExists(msg.sender)
        returns (uint transactionId)
    {
        transactionId = addTransaction(destination, value, data, proposal);
        confirmTransaction(transactionId);
    }

    /// @dev **Try Deleting** Overrides MultiSigWallet to use transactionExists Modifier
    function confirmTransaction(uint transactionId)
        public
        ownerExists(msg.sender)
        transactionExists(transactionId)
        notConfirmed(transactionId, msg.sender)
    {
        confirmations[transactionId][msg.sender] = true;
        emit Confirmation(msg.sender, transactionId);
        executeTransaction(transactionId);
    }


    ///@dev Overrides the MultiSigWallet struct transactions with proposalTransaction
    function executeTransaction(uint transactionId)
        public
        ownerExists(msg.sender)
        confirmed(transactionId, msg.sender)
        notExecuted(transactionId)
    {
        if (isConfirmed(transactionId)) {
            ProposalTransaction storage txn = proposalTransactions[transactionId];
            txn.executed = true;
            if (external_call(txn.destination, txn.value, txn.data.length, txn.data)){
                emit Execution(transactionId);
            }
            else {
                emit ExecutionFailure(transactionId);
                txn.executed = false;
            }
        }
    }

    /**
     * Internal functions
     */
    ///@dev Overrides the MultiSigWallet struct transactions with proposalTransaction
    ///@param proposal is an explanation of the transaction
    function addTransaction(address destination, uint value, bytes memory data, string memory proposal)
        internal
        notNull(destination)
        returns (uint transactionId)
    {
        transactionId = transactionCount;
        proposalTransactions[transactionId] = ProposalTransaction({
            destination: destination,
            value: value,
            data: data,
            executed: false,
            proposal: proposal
        });
        transactionCount += 1;
        emit Submission(transactionId);
    }

    /*
     * Getter functions
     */
    ///@dev Overrides the MultiSigWallet struct transactions with proposalTransaction
    function getTransactionCount(bool pending, bool executed)
        public
        view
        returns (uint count)
    {
        for (uint i = 0; i < transactionCount; i++){
            if (pending && !proposalTransactions[i].executed || executed && proposalTransactions[i].executed){
                count += 1;
            }
        }
    }

    ///@dev Overrides the MultiSigWallet struct transactions with proposalTransaction
    function getTransactionIds(uint from, uint to, bool pending, bool executed)
        public
        view
        returns (uint[] memory _transactionIds)
    {
        uint[] memory transactionIdsTemp = new uint[](transactionCount);
        uint count = 0;
        uint i;
        for (i = 0; i < transactionCount; i++){
            if (pending && !proposalTransactions[i].executed || executed && proposalTransactions[i].executed) {
                transactionIdsTemp[count] = i;
                count += 1;
            }
        }
        _transactionIds = new uint[](to - from);
        for (i = from; i < to; i++){
            _transactionIds[i - from] = transactionIdsTemp[i];
        }
    }
}
